def birthdayCakeCandles(ar):
    
    return ar.count(max(ar))
    
    '''high = 0
    counter = 0print r

    # identify highest number
    for c1 in ar:
        for c2 in ar:
            if high <= c2:
                high = c2        
            if high <= c1: 
                high = c1
        
        # count highest number            
        if c1 == high:
            counter = counter + 1         
    
    print counter
    return counter '''
    
birthdayCakeCandles(ar)
